content:
@JonHansenTV and I had an interesting discussion on this. 
We both take joy in Nick Bosa losing, obviously.
But I completely understand why he would be brought to tears after a Super Bowl loss. Jon says it’s a little much and he needs to grow up. What say you? https://t.co/gY3ZsXrNOk

@_Riles23 Jonathan Hickman, fat with joy, leans back in his chair and takes an exaggerated breath in. The Marvel conference room is hushed where Jonathan is about to give the pitch of his life. The anticipation is thick like fog. 
Mr. Hickman speaks...
“What if we give them swords?”
